import * as React from "react";
import styled from "styled-components";

function SideMenuButton(props) {
  return (
    <svg data-name="Layer 1" viewBox="0 0 217 145" {...props}>
      <path
        d="M144.5.5H.5v144h144a72 72 0 000-144zm0 135a63 63 0 1163-63 63 63 0 01-63 63z"
        fill="#662d91"
        stroke="#231f20"
        strokeMiterlimit={10}
      />
    </svg>
  );
}

const MemoSideMenuButton = React.memo(SideMenuButton);

const StyledButton = styled(MemoSideMenuButton)`
  width: 85px;
  position: fixed;
  left: 0;
`;

const ButtonBackgound = styled.div``;

export default StyledButton;
